import React from 'react';
import TodoItem from './TodoItem';

import {
    Card,

} from "@material-ui/core";
import { Clear, Create } from "@material-ui/icons";

function Todo({ todos }) {
    return (
        <Card>
            {todos.map((todo) => (
                            <TodoItem
                                todo={todo}
                                key={todo.id}
                            />
                        ))}
        </Card>
    );
}

export default Todo;
